  [],\n\t\"revision_timestamp\": \"2016-07-27T22:52:25.549990\",\n\t\"name\": \"national-elk-refuge-annual-narrative-report-calendar-year-1980\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for National
  Elk Refuge outlines Refuge accomplishments during the 1980 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, public participation, and compliance with environmental and
  cultural resource mandates. Refuge administration is outlined; information about
  personnel, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, grasslands, grazing, fire management,
  pest control, and water rights. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, fisheries resources, and disease control. The
  public uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about rehabilitation,
  major maintenance, and equipment replacement. Cooperative programs and items of
  interest are provided at the end. Refuge brochures are attached.\",\n\t\"license_title\":
